/*Table structure for table `b_usuario` */

DROP TABLE IF EXISTS `b_usuario`;

CREATE TABLE `b_usuario` (
  `id_usuario` int(11) DEFAULT NULL,
  `prefijo` varchar(1) COLLATE utf8_bin DEFAULT NULL,
  `actividad` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `fecha` datetime DEFAULT NULL,
  `cod_submodulo` int(11) DEFAULT '0',
  KEY `id_usuario` (`id_usuario`),
  KEY `cod_submodulo` (`cod_submodulo`),
  CONSTRAINT `b_usuario_ibfk_2` FOREIGN KEY (`cod_submodulo`) REFERENCES `s_sub_modulo` (`cod_submodulo`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `b_usuario_ibfk_3` FOREIGN KEY (`id_usuario`) REFERENCES `s_usuario` (`id_usuario`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

