DROP TABLE IF EXISTS `consultorio_horario`;

CREATE TABLE `consultorio_horario` (
  `cod_consu_horario` int(11) NOT NULL AUTO_INCREMENT,
  `num_consultorio` int(11) DEFAULT NULL,
  `manana` int(11) DEFAULT NULL,
  `tarde` tinyint(1) DEFAULT NULL,
  `noche` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`cod_consu_horario`),
  KEY `cod_turno` (`manana`),
  KEY `num_consultorio` (`num_consultorio`),
  CONSTRAINT `consultorio_horario_ibfk_2` FOREIGN KEY (`manana`) REFERENCES `turno` (`cod_turno`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `consultorio_horario_ibfk_6` FOREIGN KEY (`num_consultorio`) REFERENCES `consultorio` (`num_consultorio`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

